`;

const Issueheader = styled.h2``;

const Inheaders = (props) => {

return (
    <Inheader>
        <Issueheader>Issue</Issueheader>
        <Search type="text" placeholder="Issue名で検索"/>
        <Buttons  background="rgb(66, 195, 96)" color="white" border-bottom=""onClick={() => props.open} />
        <Buttons onClick={() => props.delete}/>
    </Inheader>
    )

}

export default Inheaders
